import React, {useState} from 'react';
import {useHistory} from 'react-router-dom'

const ChooseTest = () => {
    const [test, setTest] = useState('');
    const handleChange = ()=>{
        setTest(event.target.value);  
    }
    return(
        <>
        <h3>Which test are you gonna take?</h3>
        <div>
            <label><input onChange={handleChange} type="radio" value="academicielts" name="test"/> Academic IELTS </label>
            <label><input onChange={handleChange} type="radio" value="geenralielts" name="test"/> General IELTS </label>
            <label><input onChange={handleChange} type="radio" value="toelf" name="test"/> TOELF </label>
        </div>
        <button onClick={()=>{console.log(test)}}>Start</button>
        </>
    
    )
}

export default ChooseTest;
